import {Component} from "react";
import CompDisplay from "./ProgLangDisplay";
import './css/style.css';
import ReactIcon from './css/img/react.png';
import ProgLangDisplay from "./ProgLangDisplay";

class ProgLang extends Component{

    render(){
        return(
            <div className={"progLang"}>
                <h2 className={"title"}>Langages de programmation</h2>
                <ProgLangDisplay className={"progLangDisplay"} name={"React"} img={ReactIcon}/>
                <ProgLangDisplay className={"progLangDisplay"} name={"Java"} img={ReactIcon}/>
                <ProgLangDisplay className={"progLangDisplay"} name={"PHP"} img={ReactIcon}/>
                <ProgLangDisplay className={"progLangDisplay"} name={"C#"} img={ReactIcon}/>
                <ProgLangDisplay className={"progLangDisplay"} name={"Git"} img={ReactIcon}/>
                <ProgLangDisplay className={"progLangDisplay"} name={"Bash"} img={ReactIcon}/>
                <ProgLangDisplay className={"progLangDisplay"} name={"C"} img={ReactIcon}/>
                <ProgLangDisplay className={"progLangDisplay"} name={"Unity"} img={ReactIcon}/>
                <ProgLangDisplay className={"progLangDisplay"} name={"Oracle"} img={ReactIcon}/>
                <ProgLangDisplay className={"progLangDisplay"} name={"Javascript"} img={ReactIcon}/>
                <ProgLangDisplay className={"progLangDisplay"} name={"HTML"} img={ReactIcon}/>
                <ProgLangDisplay className={"progLangDisplay"} name={"CSS"} img={ReactIcon}/>
                <hr/>
            </div>

        );
    }
}

export default ProgLang;
